import porto1 from '../Porto1.jpg';
import porto2 from '../Porto2.jpg';
import porto3 from '../Porto3.jpg';
import porto4 from '../Porto4.jpg';
import porto5 from '../Porto5.jpg';
import porto6 from '../Porto6.jpg';

const data = {
    portofolio : [
        {gambar : porto1, caption : "html"},
        {gambar : porto2, caption : "css"},
        {gambar : porto3, caption : "javascript"},
        {gambar : porto4, caption : "react"},
        {gambar : porto5, caption : "node"},
        {gambar : porto6, caption : "epxress js"}
    ]
}

export default data;
